// ==UserScript==
// @name         低调使用
// @namespace    https://www.wnflb2023.com/
// @version      1.0.1
// @description  嗨起来！
// @author       FULIBA
// @include      https://*.fi11*.com/*
// @include      *webal.*.com/*
// @license      WTFPL
// @icon         data:image/png;base64,
// @run-at       document-start
// @require      https://cdn.bootcdn.net/ajax/libs/crypto-js/4.2.0/crypto-js.min.js

// @downloadURL https://update.greasyfork.org/scripts/486746/%E4%BD%8E%E8%B0%83%E4%BD%BF%E7%94%A8.user.js
// @updateURL https://update.greasyfork.org/scripts/486746/%E4%BD%8E%E8%B0%83%E4%BD%BF%E7%94%A8.meta.js
// ==/UserScript==

(function () {
    'use strict';

    const href = window.location.href;
    const originOpen = XMLHttpRequest.prototype.open;

    const hxc = {
        currentTime: new Date(),
        regex: {
            getTimeStamp: /\/base\/getTimeStamp/,
            getConfigPub: /\/base\/getConfigPub/,
            getPreUrl: /\/videos\/getPreUrl/,
        },
        getCurrentDayStr: function () {
            var year = this.currentTime.getFullYear();
            var month = ("0" + (this.currentTime.getMonth() + 1)).slice(-2);
            var day = ("0" + this.currentTime.getDate()).slice(-2);
            return year + "-" + month + "-" + day;
        },
        resetTryPlayNum: function () {
            let _that = this;
            let preInfo = {
                time: _that.getCurrentDayStr(),
                preNum: 99999999999999,
                count: 0
            };
            let visitorShortLimit = {
                time: _that.getCurrentDayStr(),
                count: -99999999999999
            };
            localStorage.setItem("preInfo", JSON.stringify(preInfo));
            localStorage.setItem("visitorShortLimit", JSON.stringify(visitorShortLimit));
            localStorage.setItem("tryPlayNum", "");
        },
        rebuildM3u8Url: function (preUrl) {
            if (!preUrl) {
                return "";
            }
            return preUrl.replace(/([?&])(start=)\d+/i, "$1$2").replace(/([?&])(end=)\d+/i, "$1$2");
        },
        processResp: function (requestUrl, respText, xhr) {
            if (this.regex.getTimeStamp.test(requestUrl) && respText) {
                let res = JSON.parse(respText);
                if (res.data && res.data.timeStamp) {
                    this.currentTime = new Date(parseInt(res.data.timeStamp) * 1000);
                }
            } else if (this.regex.getConfigPub.test(requestUrl) && respText) {
                let res = JSON.parse(respText);
                if (res.data) {
                    res.data.visitorShortNum = 99999999999999;
                    res.data.visitorLongNum = 99999999999999;
                }
                return JSON.stringify(res);
            } else if (this.regex.getPreUrl.test(requestUrl) && respText) {
                let res = JSON.parse(respText);
                if (res.data && res.data.url) {
                    res.data.url = this.rebuildM3u8Url(res.data.url);
                }
                return JSON.stringify(res);
            }
            this.resetTryPlayNum();
            return respText;
        }
    }

    const fuLao2 = {
        regex: {
            getUserInfo: /\/v1\/user\/info/,
            getVideoInfo: /\/v1\/video\/info/
        },
        resetStreamUrls: function () {
            let app = document.querySelector("#app") && document.querySelector("#app").__vue__;
            if (app && app.$store) {
                let stream = ((app.$store.state.hostList || {}).stream || []);
                let urls = stream.filter(x => {
                    return x.mode == "novipfinal" || x.mode == "novip";
                });
                let line = urls[Math.floor(Math.random() * urls.length)];
                app.$store.state.urlList.stream.url = line.url || 'https://ptv-al.nauov.com';
            }
        },
        key: '3a0fd42302f0aada8abc0529a2bde5aa',
        encodeRespText(respText, vtag) {
            let key = this.key;
            let iv = CryptoJS.MD5(vtag).toString().substring(8, 24);
            let e = CryptoJS.AES.encrypt(respText, CryptoJS.enc.Utf8.parse(key), {
                iv: CryptoJS.enc.Utf8.parse(iv),
                mode: CryptoJS.mode.CBC,
                padding: CryptoJS.pad.Pkcs7
            }).ciphertext;
            return CryptoJS.enc.Base64.stringify(e);
        },
        decodeRespText(respText, vtag) {
            let key = this.key;
            let iv = CryptoJS.MD5(vtag).toString().substring(8, 24);
            return CryptoJS.AES.decrypt(respText, CryptoJS.enc.Utf8.parse(key), {
                iv: CryptoJS.enc.Utf8.parse(iv),
                mode: CryptoJS.mode.CBC,
                padding: CryptoJS.pad.Pkcs7
            }).toString(CryptoJS.enc.Utf8);
        },
        processResp: function (requestUrl, respText, xhr) {
            if (this.regex.getUserInfo.test(requestUrl) && respText) {
                let vtag = xhr.getResponseHeader('x-vtag')
                    let t = JSON.parse(this.decodeRespText(respText, vtag));
                if (t.response) {
                    t.response.avip = 2;
                    t.response.points = 9999999999999;
                    t.response.credits = 9999999999999;
                    t.response.expiry = 9999999999999;
                    t.response.video_limits = 9999999999999;
                    t.response.level = 2;
                    t.response.vip = 2;
                    return this.encodeRespText(JSON.stringify(t), vtag);
                }
            } else if (this.regex.getVideoInfo.test(requestUrl) && respText) {
                this.resetStreamUrls();
                let vtag = xhr.getResponseHeader('x-vtag')
                    let t = JSON.parse(this.decodeRespText(respText, vtag));
                if (t.response) {
                    t.response.is_vip = false;
                    let video_urls = t.response.video_urls || {};
                    if (!video_urls['240'] && !video_urls['480']) {
                        let intro = video_urls['intro'];
                        if (!intro) {
                            let video_id = t.response.video_id;
                            video_urls['240'] = '/media/240/' + video_id + '.m3u8?expire=&hash=';
                            video_urls['480'] = '/media/480/' + video_id + '.m3u8?expire=&hash=';
                        } else {
                            video_urls['240'] = intro.replace("/intro/", "/240/");
                            video_urls['480'] = intro.replace("/intro/", "/480/");
                        }
                    }
                    return this.encodeRespText(JSON.stringify(t), vtag);
                }
            }
            return respText;
        }
    }

    let workspace = fuLao2;

    if (/.+\.fi11\w+.com.*/gi.test(window.location.href)) {
        console.log("含羞草")
        workspace = hxc;
    }

    XMLHttpRequest.prototype.open = function (method, url, async, username, password) {
        const xhr = this;
        const getter = Object.getOwnPropertyDescriptor(XMLHttpRequest.prototype, "response").get;
        Object.defineProperty(xhr, "responseText", {
            get: () => {
                let result = getter.call(xhr);
                try {
                    if (workspace.processResp) {
                        result = workspace.processResp(url, result, xhr);
                    }
                } catch (e) {
                    console.log('发生错误! ');
                    console.log(e);
                }
                return result;
            },
        });

        originOpen.apply(this, arguments);
    };

})();
